          {/* <div>
            <Map food={this.state.food != ''? this.state.food : this.state.placeholder}/>
          </div> */}
          <div>
            <Sidebar extended={this.state.extended} />
          </div>
        </body>

      </div>
    );
  }
}

export default App;
